import React, { useState } from "react";

const Count = () => {
  const [count, setCount] = useState(0);
  const changeCount = () => {
    count = count + 1;
  };
  return (
    <div>
      <p>{count}</p>
      <button onClick={changeCount}>+</button>
      <button onClick={setCount((prev) => prev - 1)}>+</button>
    </div>
  );
};

export default Count;
